pub enum Cw721ExecuteMsg {
    TransferNft {
            recipient: String,
            token_id: String,
        },
    SendNft {
            contract: String,
            token_id: String,
            msg: Binary,
        },
    Approve {
            spender: String,
            token_id: String,
            expires: Option<Expiration>,
        },
    Revoke {
            spender: String,
            token_id: String,
        },
    ApproveAll {
            operator: String,
            expires: Option<Expiration>,
        },
    RevokeAll {
            operator: String,
        },
}

pub enum Cw721QueryMsg {
    OwnerOf {
            token_id: String,
            include_expired: Option<bool>,
        },
    ApprovedForAll {
            owner: String,
            include_expired: Option<bool>,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    NumTokens {
        },
    ContractInfo {
        },
    NftInfo {
            token_id: String,
        },
    AllNftInfo {
            token_id: String,
            include_expired: Option<bool>,
        },
    Tokens {
            owner: String,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllTokens {
            start_after: Option<String>,
            limit: Option<u32>,
        },
}
